import React from "react";
import { Box, Center, HStack } from "native-base";

export default function App() {
  return (
    <Center h="100vh" bg="coolGray.900">
      <HStack mb="4">
        <Box h="150px" w="150px" roundedTopLeft="full" bg="white"></Box>
        <Box h="150px" w="150px" roundedTopRight="full" bg="white"></Box>
      </HStack>
      <HStack>
        <Box h="150px" w="150px" roundedBottomLeft="full" bg="white"></Box>
        <Box h="150px" w="150px" roundedBottomRight="full" bg="white"></Box>
      </HStack>
    </Center>
  );
}
